import React from 'react'
import Card from './Card';
const Review = () => {
    return (
        <>
            <section className="mt-5">
                <div className="container">
                    <div className="row">
                            <Card/>
                    </div>
                </div>
            </section>  
        </>
    )
}
export default Review;
